import React from "react";
import logoFooter from "../assets/FooterDesktop.png";

Footer = () => {
  return (
    <div className="navigation-container">
      <div className="logo">
        <img src={logoFooter} alt="logo bas de page" />
      </div>
    </div>
  );
};

export default Footer;
